// An HTML5Entity struct represents HTML5 entitites.
type HTML5Entity struct {
	Name       string
	CodePoints []int
	Characters []byte
}

// LookUpHTML5EntityByName returns (an HTML5Entity, true) if an entity named
// given name is found, otherwise (nil, false)
